import React from 'react';
import { Box, Heading } from 'grommet';

const landing = ({ location, fetchSuccess }) => {
  return (
    <Box 
      pad={{ "left": "small", "right": "small" }} 
      animation="fadeIn"
      justify="center" 
      align="center" 
      height="100%"
    >
      {/* fetchSuccess || fetchSuccess === '' */}
      {fetchSuccess || fetchSuccess === '' ? 
        (
          <React.Fragment>
            <Heading 
              textAlign="center" 
              color="dark-1" 
              margin="none"
              size="small"
            >
              Where to eat in
            </Heading>
            <Heading 
              color="status-warning" 
              margin="none"
              size="large" 
            >
              {location}
            </Heading>
          </React.Fragment>
        )
        : (
          <Heading>unable to fetch</Heading>
        )
      }

    </Box>
  )
}

export default landing;
